const state = {
    robots : robots,
    searchfields : '',
}

class App  extends React.Component {
    render() {
    return (
        <div className="tc">
            <h1>Robot Friends</h1>
            <SearchBox/>
            <br/>
            <CardList robots={robots}/>
        </div>
    )
}
}

export default App;
